/// <summary>
/// Updating the bank code lookpups from the W0X fields.
/// </summary>
protected void updateBankCodelookupValues()
{
    switch(gSKS_EFT_FileFormat.FormatId)
    {
        case ('EU-NORDEA-CORP-FI'):
            if(gSKS_EFT_Bank.W01)
            {
                this.updateBankFields('SenderId', gSKS_EFT_Bank.W01);
            }
            if(gSKS_EFT_Bank.W02)
            {
                this.updateBankFields('BankId', gSKS_EFT_Bank.W02);
            }
            if(gSKS_EFT_Bank.W03)
            {
                this.updateBankFields('Btchbkg', gSKS_EFT_Bank.W03, true);
            }
            break;
        case ('EU-NORDEA-CORP-DK'):
            if(gSKS_EFT_Bank.W01)
            {
                this.updateBankFields('SenderId', gSKS_EFT_Bank.W01);
            }
            if(gSKS_EFT_Bank.W02)
            {
                this.updateBankFields('BankId', gSKS_EFT_Bank.W02);
            }
            if(gSKS_EFT_Bank.W03)
            {
                this.updateBankFields('Btchbkg', gSKS_EFT_Bank.W03, true);
            }
            break;
        case ('EU-NORDEA-CORP-NO'):
            if(gSKS_EFT_Bank.W01)
            {
                this.updateBankFields('SenderId', gSKS_EFT_Bank.W01);
            }
            if(gSKS_EFT_Bank.W02)
            {
                this.updateBankFields('BankId', gSKS_EFT_Bank.W02);
            }
            break;
        case ('EU-NORDEA-CORP-SE'):
            if(gSKS_EFT_Bank.W01)
            {
                this.updateBankFields('SenderId', gSKS_EFT_Bank.W01);
            }
            if(gSKS_EFT_Bank.W02)
            {
                this.updateBankFields('BankId', gSKS_EFT_Bank.W02);
            }
            break;

    }
}

